import React from 'react';
import { PieChart } from 'react-minimal-pie-chart';
import './css/style.css';


class App extends React.Component {

  render() {

    return (
      <div class="main-page">
        <h1 id="main-head">Room Capacity Checkr</h1>
        <h2>Room number: </h2>
        <div class="occupancy-pie-chart">

          <PieChart 
            animate={true}
            label={({ dataEntry }) => `${Math.round(dataEntry.percentage)} %`}
            data={[
              { title: 'occupied spots', value: 10, color: '#fa0000', label: "Occupied"}, //occupied
              { title: 'free spots', value: 15, color: '#3efa00' }, //free
            ]}
          />
        </div> 

        <a href="https://www.cdc.gov/coronavirus/2019-ncov/travelers/travel-in-the-us.html?s_cid=bb-coronavirus-2019-ncov-NCIRD6" title="Protect yourself and others during travel in the US - COVID-19"><img src="http://www.cdc.gov/coronavirus/2019-ncov/travelers/images/COVID-19-Domestic-Travel-Badge_300x250.jpg" style="width:300px; height:250px; border:0px;" alt="Protect yourself and others during travel in the US - COVID-19"/></a>
      </div>
    );
  }

}

export default App;
